/*Should print an undending supply of fibbonacci numbers (ending when we run out of cells)*/
const char *prog_fibbo = ">++++++++++>+>+[[+++++[>++++++++<-]>.<++++++[>--------<-]+<<<]>.>>[[-]<[>+<-]>>[<<+>+>-]<[>+<-[>+<-[>+<-[>+<-[>+<-[>+<-[>+<-[>+<-[>+<-[>[-]>+>+<<<-[>+<-]]]]]]]]]]]+>>>]<<<]";
/*Should print a christmas tree with supplied number as the length*/
const char *prog_xmas = ">>>--------<,[<[>++++++++++<-]>>[<------>>-<+],]++>>++<--[<++[+>]>+<<+++<]<<[>>+[[>>+<<-]<<]>>>>[[<<+>.>-]>>]<.<<<+<<-]>>[<.>--]>.>>.";

/*Should end with 0x18 in cell 2 (0 based)*/
const char *prog_mult = "++++[->+++[->++<]<]>";
/*Should end with 0x3C in cell 2 (0 based)*/
const char *prog_triple_mult = "++++[-]++++++[->+++++[->++<]<]>>";
/*should end with 0x5 in cell 2 (0 based)*/
const char *prog_move = "+++++ >>[-]<<[->>+<<]";

#define DEBUG_NATIVE 0

void main(void)  {

	struct VM vm;
	int error;

	Instruction_t *bytecode;
	size_t bytecode_length;

	uint8_t *native_code;
	size_t native_length;

	const char *program = prog_fibbo;

	os_ClrHome();
	fill_screen(0xFF);

	vm_Create(&vm);

	console_print("Compiling bytecode...\n");

	compile_bytecode(program, &bytecode, &bytecode_length, &error);

	if (error != E_SUCCESS) {
		char buffer[30];
		sprintf(buffer, "Bytecode compile error %i\0", error);
		console_print(buffer);
		pause();
		return;
	}

	console_print("Compiled bytecode...\nCompiling native...\n");

	compile_native(bytecode, bytecode_length, &native_code, &native_length, &vm, &error);

	if (error != E_SUCCESS) {
		char buffer[30];
		sprintf(buffer, "Native compile error %i\0", error);
		console_print(buffer);
		pause();
		return;
	}

	console_print("Compiled native.\n\n");

	console_print("\nExecuting...\n");

	if(DEBUG_NATIVE)
		dbg_SetBreakpoint(native_code);

	(* ((void(*)()) native_code)) ();

	free(bytecode);
	free(native_code);

	console_print("Done.\n");

	//print the first 6 cells for debugging purposes
	debug_print_array(vm.cells, 6);
	
	//again, this is sketch because I'm just testing native rn.
	//I will clean all this up when I make a gui.
	pause();
	return;


	console_print("Compiling bf...\n");
	vm_Create(&vm);
	error = vm_Compile(&vm, program);

	if(error != E_SUCCESS) {
		char buffer[25];
		sprintf(buffer, "Compile error %i\0", error);
		console_print(buffer);
		pause();
		vm_Cleanup(&vm);
		return;
	}

	while(!vm_IsDone(&vm)) {

		int error = vm_Step(&vm);
		if(error != E_SUCCESS) {
			char buffer[25];
			sprintf(buffer, "Runtime error %i\nUsing %i %i byte cells\0", error, NUM_CELLS, sizeof(CELL_TYPE));
			console_print(buffer);
			break;
		}
	}


	console_print("Done.\n\n");

	vm_Cleanup(&vm);

	pause();
}

//the text positions
uint16_t text_x = 0; uint8_t text_y = 0;
void console_print_char(char cell) {
	//is it possible for %c to print more than one character? hope not lol
	char buffer[2];
	sprintf(buffer, "%c\0", cell);

	if(buffer[0] == '\n') {
		text_y += 12;
		text_x = 0;
	} else {
		os_FontDrawText(buffer, text_x, text_y);
		text_x += 8;
	}
}

void console_print(const char *str) {
	int i;
	for(i = 0; i < strlen(str); i++) {
		console_print_char(str[i]);
	}
}

void debug_print_array(CELL_TYPE *arr, size_t size) {
	size_t i = 0;

	console_print_char('{');

	for(; i < size; i++) {
		char buffer[10];
		sprintf(buffer, "%02X\0", arr[i]);
		console_print(buffer);
		if(i != size - 1) {
			console_print(", ");
		}
	}

	console_print_char('}');
}

void bf_print_cell(CELL_TYPE cell) {
	console_print_char((char)cell);
}

//hacky way to supply input to the xmas tree program
int index = 0;
CELL_TYPE bf_get_input() {
	int ret = 'A';
	if(index == 0) ret = '1';
	else if(index == 1) ret = '0';
	else if(index >= 2) ret = 0;
	index++;
	return ret;
}